import React, { Component } from 'react';

class MakeBoard extends Component {
    constructor(){
        super();
        this.state = {
            title: "",
            description: "",
            images: []
        }
    }
    render(){
        return (
            <h1>MakeBoard</h1>
        )
    }

}

export default MakeBoard;
